import React from 'react';
import { List, Avatar, Space } from 'antd';


const Artist = (props) => {
    return (
        <List
            itemLayout="vertical"
            size="large"
            pagination={{
                onChange: page => {
                    console.log(page);
                },
                pageSize: 3,
            }}
            dataSource={props.data}
            // footer={ }
            renderItem={item => (
                <List.Item
                    key={item.name}
                    actions={[]}
                    extra={
                        <img
                            width={272}
                            alt="logo"
                            src={item.picture}
                        />
                    }
                >
                    <List.Item.Meta
                        // avatar={<Avatar src={item.avatar} />}
                        title={<a href={`/${item.id}`}>{item.name}</a>}
                        description={item.description}
                    />
                    {item.content}
                </List.Item>
            )}
        />
    )
}

export default Artist;
